import React,{useState,useEffect} from "react";
import axios from "axios";

const PersonFList = () =>{
    const [users,setUsers] = useState([])
    useEffect (() =>{
        axios.get('https://jsonplaceholder.typicode.com/user').then(req=>{
            const dadosUsers=req.data
            setUsers(dadosUsers)
        })
    })
    return(
        <>
            {users.map((item,index)=><div>{item.name} - {item.email}</div>)}
        </>
    )
}
